    t[192] = "SAM (Simple Anonymous Messaging) is a protocol which allows a client application written in any programming language to communicate over I2P, by using a socket-based interface to the I2P router. For more information, see the <a href=https://geti2p.net/en/docs/api/samv3 class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[193] = "SAM (Simple Anonymous Messaging) er en protokol, der giver en klientapplikation, der er skrevet i et hvilket som helst programmeringssprog, mulighed for at kommunikere over I2P ved at bruge en socket-baseret gr\u00e6nseflade til I2P-routere. For mere information, se <a href=https://geti2p.net/en/docs/api/samv3 class='sitelink external' target=_blank rel=noreferrer>online-dokumentationen</a>.";
