    t[236] = "Advanced Router Configuration";
    t[237] = "Avanceret routerkonfiguration";
    t[238] = "Allocate number of processor threads for building tunnels. If your processor supports hyperthreading or simultaneous multithreading, you may multiply the number of processor cores by 2 to get the maximum number of threads to allocate, otherwise number of processor cores = maximum number of threads available. Note that you may wish to allocate less than the theoretical maximum to ensure you have headroom for other tasks.";
    t[239] = "Opdel antallet af processor-tr\u00e5de, der skal bruges til at opbygge tunneler. Hvis din processor underst\u00f8tter hypertr\u00e5dning eller samtidig multitr\u00e5dning, kan du gange antallet af processorkerner med 2 for at f\u00e5 det maksimale antal tr\u00e5de, der skal allokeres. Ellers svarer antallet af processorkerner til det maksimale antal tilg\u00e6ngelige tr\u00e5de. Bem\u00e6rk, at du muligvis \u00f8nsker at allokerer mindre end det teoretiske maksimum for at sikre, at du har plads til andre opgaver.";
