    t[364] = "When a new service tunnel is created, or a service is run for the first time (e.g. the default jetty webserver, plugins), a private encryption key is created which essentially controls the ownership of address. This is usually named <code>&hellip;privKey.dat</code>, or <code>eepPriv.dat</code>, though it's a good idea to change the name to indicate the service it belongs to and then respecify it in the Tunnel Manager server settings. This .dat file should be backed up safely; lose it and you will lose ownership and control of your hostname!";
    t[365] = "N\u00e5r en ny servicetunnel oprettes, eller en service k\u00f8res for f\u00f8rste gang (f.eks. standard jetty webserveren, plugins), oprettes en privat krypteringsn\u00f8gle, som i det v\u00e6sentlige styrer ejerskabet af adressen. Denne bliver normalt navngivet <code>&hellip;privKey.dat</code> eller <code>eepPriv.dat</code>, men det er en god id\u00e9 at \u00e6ndre navnet for at indikere hvilken service den tilh\u00f8rer, og derefter specificere det i Tunnel Manager serverindstillingerne. Denne .dat-fil b\u00f8r sikkerhedskopieres; mister du den, vil du miste ejerskabet og kontrol over din hostnavn!";
    t[368] = "This setting allows configuration of the maximum number of files per torrent I2PSnark will permit, when downloading or creating a torrent. Note that substantially increasing this value from the default of 2000 files may require additional configuration on the host system to increase the maximum number of open files the operating system will permit (e.g. <code>ulimit -n</code> on Linux). To change, add to I2PSnark's configuration file <code>i2psnark.config</code>. [Restart of I2PSnark or router required]";
    t[369] = "Denne indstilling tillader konfiguration af det maksimale antal filer per torrent, som I2PSnark vil tillade ved download eller oprettelse af en torrent. Bem\u00e6rk, at en v\u00e6sentlig \u00f8gning af denne v\u00e6rdi fra standarden p\u00e5 2000 filer kan kr\u00e6ve yderligere konfiguration p\u00e5 v\u00e6rtsystemet for at \u00f8ge det maksimale antal \u00e5bne filer, som operativsystemet vil tillade (f.eks. <code>ulimit -n</code> p\u00e5 Linux). For at \u00e6ndre dette, skal du tilf\u00f8je det til I2PSnarks konfigurationsfil <code>i2psnark.config</code>. [Genstart af I2PSnark eller router kr\u00e6vet]";
    t[370] = "Configure router bandwidth allocation";
    t[371] = "Konfigurer routerens b\u00e5ndbredde bevilling ";
    t[372] = "Here are some other public addressbook subscription links. You may wish to add one or two to your <a href='/dns?subscriptions' target=_blank rel=noreferrer>susidns subscription list</a>. In the event that addresses conflict in the subscriptions, the lists placed at the top of your susidns configuration will take precedence over those placed further down.";
    t[373] = "Her er nogle andre offentlige adressebogsabonnementlinks. Du kan \u00f8nske at tilf\u00f8je et eller to til din <a href='/dns?subscriptions' target=_blank rel=noreferrer>susidns abonnementsliste</a>. Hvis adresser i abonnementerne er i konflikt, vil listerne placeret \u00f8verst i din susidns-konfiguration blive prioriteret over dem, der er placeret l\u00e6ngere nede.";
