    t[615] = "Marker afkrydsningsfeltet m\u00e6rket <i>Proxy DNS when using SOCKS v5</i> for at forhindre DNS-l\u00e6kager.";
    t[616] = "Bonuses may be positive or negative, and affect the peer's inclusion in Fast and High Capacity tiers. Fast peers are used for client tunnels, and High Capacity peers are used for some exploratory tunnels.";
    t[617] = "Bonusser kan v\u00e6re positive eller negative og p\u00e5virke peer's optagelse i hurtige og h\u00f8je kapacitetsniveauer. Hurtige kammerater bruges til klienttunneler, og kammerater med h\u00f8j kapacitet bruges til nogle efterforskende tunneler.";
    t[618] = "Yes";
    t[619] = "Ja";
    t[620] = "While I2P will work fine in this configuration, if you really have over 128KBps of bandwidth to share, it will be much more helpful to the network if you open your firewall.";
    t[621] = "Selvom I2P vil fungere fint med denne ops\u00e6tning, hvis du faktisk har over 128KBps som du vil dele, vil det v\u00e6re til stor hj\u00e6lp for netv\u00e6rket hvis du \u00e5bnede din firewall.";
    t[622] = "A command-line application supplied with I2P that is used to request URL resources, similar to <a href=https://www.gnu.org/software/wget/ class='sitelink external' target=_blank rel=noreferrer>wget</a> or <a href=https://curl.haxx.se/ class='sitelink external' target=_blank rel=noreferrer>curl</a>. Eepget is also used internally by the router, for example to reseed from remote hosts. By default, eepget uses the HTTP proxy on <code>127.0.0.1:4444</code>.";
    t[623] = "En kommandolinje-applikation, som medf\u00f8lger I2P, der bruges til at anmode om URL-ressourcer, lignende <a href=https://www.gnu.org/software/wget/ class='sitelink external' target=_blank rel=noreferrer>wget</a> eller <a href=https://curl.haxx.se/ class='sitelink external' target=_blank rel=noreferrer>curl</a>. Eepget bruges ogs\u00e5 internt af routeren, f.eks. til at omplante fra eksterne kilder. Som standard bruger eepget HTTP-proxyen p\u00e5 <code>127.0.0.1:4444</code>.";
