    t[723] = "Javadocs";
    t[724] = "An eepsite is a website that is hosted anonymously on the I2P network - you can access it by configuring your web browser to use I2P's HTTP proxy (see above) and browsing to the <code>.i2p</code> suffixed website (e.g. <a href=http://i2p-projekt.i2p/ target=_blank rel=noreferrer class=sitelink>http://i2p-projekt.i2p</a>). Also ensure your browser is configured to resolve DNS remotely when using the proxy to avoid DNS leaks.";
    t[725] = "En eepsite er en hjemmeside, der er v\u00e6rt anonymt p\u00e5 I2P-netv\u00e6rket - du kan f\u00e5 adgang til den ved at konfigurere din webbrowser til at bruge I2P's HTTP-proxy (se ovenfor) og browse til den <code>.i2p</code> suffikserede hjemmeside (f.eks. <a href=http://i2p-projekt.i2p/ target=_blank rel=noreferrer class=sitelink>http://i2p-projekt.i2p</a>). S\u00f8rg ogs\u00e5 for, at din browser er konfigureret til at l\u00f8se DNS eksternt, n\u00e5r du bruger proxyen for at undg\u00e5 DNS-l\u00e6kager.";
