    t[836] = "The first number is the number of peers your router has sent or received a message from in the last few minutes. This may range from 8-10 to several hundred, depending on your total bandwidth, shared bandwidth, and locally-generated traffic. The second number is the number of peers seen in the last hour or so. Do not be concerned if these numbers vary widely. <a href='/configstats#router.activePeers'>[Enable graphing]</a>.";
    t[837] = "Det f\u00f8rste nummer er antallet af peers, som din router har sendt eller modtaget en besked fra i de sidste par minutter. Dette kan variere fra 8-10 til flere hundrede, afh\u00e6ngigt af din samlede b\u00e5ndbredde, delt b\u00e5ndbredde og lokalt genereret trafik. Det andet nummer er antallet af peers, der er set i den sidste time eller deromkring. Du beh\u00f8ver ikke bekymre dig, hvis disse tal varierer meget. <a href='/configstats#router.activePeers'>[Aktiv\u00e9r graf]</a>.";
