    t[1174] = "Unless an outproxy has been set up for the service you want to connect to, this is not possible, with the exception of BitTorrent (see below). There are only three types of outproxies running right now: HTTP, HTTPS, and email. Note that there is currently no publicly listed SOCKS outproxy. If this type of service is required, try <a href=https://torproject.org/ target=_blank rel=noreferrer class='sitelink external'>Tor</a>.";
    t[1175] = "Medmindre en udproxy er blevet sat op for den service, du \u00f8nsker at forbinde til, er dette ikke muligt, med undtagelse af BitTorrent (se nedenfor). Der k\u00f8rer i \u00f8jeblikket kun tre typer udproxies: HTTP, HTTPS og e-mail. Bem\u00e6rk, at der i \u00f8jeblikket ikke findes en offentligt opf\u00f8rt SOCKS-udproxy. Hvis denne type service er p\u00e5kr\u00e6vet, s\u00e5 pr\u00f8v <a href=https://torproject.org/ target=_blank rel=noreferrer class='sitelink external'>Tor</a>.";
