    t[1209] = "Ser Big Tech...";
    t[1212] = "The skew (offset) of your computer's clock relative to the network-synced time (if known). I2P requires your computer's time be accurate. If the skew is more than a few seconds, please correct the problem by adjusting your computer's time. If I2P cannot connect to the internet, a reading of 0ms may be indicated. Note: This is only displayed in the <i>Router Information (advanced)</i> section. You may add this section to your Sidebar on the <a href='/configsidebar'>Sidebar Configuration page</a>.";
    t[1213] = "Sk\u00e6vheden (forskydningen) af din computers ur i forhold til det netv\u00e6rkssynkroniserede tidspunkt (hvis kendt). I2P kr\u00e6ver, at din computers tid er n\u00f8jagtig. Hvis sk\u00e6vheden er mere end et par sekunder, skal du rette problemet ved at justere din computers tid. Hvis I2P ikke kan oprette forbindelse til internettet, kan der angives en l\u00e6sning af 0ms. Bem\u00e6rk: Dette vises kun i afsnittet <i>Routerinformation (avanceret)</i>. Du kan tilf\u00f8je dette afsnit til din sidebj\u00e6lke p\u00e5 siden <a href='/configsidebar'>Sidebar Configuration</a>.";
