    t[2188] = "The following threshold definition <i class=example>180/60</i> specifies that the same remote destination is allowed to make 179 connection attempts during a 60 second period. If it makes one more attempt within the same period, the threshold will be breached and further connection attempts will be rejected until the end of the period:";
    t[2189] = "F\u00f8lgende t\u00e6rskeldefinition <i class=example>180/60</i> angiver, at den samme fjerndestination har lov til at foretage 179 forbindelsesfors\u00f8g i l\u00f8bet af en 60 sekunders periode. Hvis det foretager et fors\u00f8g mere inden for samme periode, vil t\u00e6rsklen blive brudt, og yderligere forbindelsesfors\u00f8g vil blive afvist indtil periodens afslutning:";
