    t[2254] = "Before you tell the world about your new website, you should add some content. Go to the server's root directory <a href=#rootdir>listed above</a> and replace the <i>index.html</i> redirect page with your own content. If you need a template for a basic site, feel free to adapt <a href=http://127.0.0.1:7658/help/pagetemplate.html>this page</a>. If you're returned to this page after editing the content, try clearing your browser's web cache.";
    t[2255] = "Inden du fort\u00e6ller verden om din nye hjemmeside, b\u00f8r du tilf\u00f8je noget indhold. G\u00e5 til serverens rodmappe <a href=#rootdir>som er angivet ovenfor</a> og erstat omdirigeringsiden <i>index.html</i> med dit eget indhold. Hvis du har brug for en skabelon til en simpel hjemmeside, er du velkommen til at tilpasse <a href=http://127.0.0.1:7658/help/pagetemplate.html>denne side</a>. Hvis du vender tilbage til denne side efter at have redigeret indholdet, skal du pr\u00f8ve at rydde din browsers web-cache.";
