    t[2313] = "Hvis din router har 10 eller flere aktive samarbejdspartnere, er alt i orden. Routeren skal opretholde forbindelse til nogle f\u00e5 samarbejdspartnere hele tiden. Den bedste m\u00e5de at v\u00e6re bedre forbindelse til netv\u00e6rket er at <a href=/config>dele mere b\u00e5ndbredde</a>.";
