    t[2376] = "To obtain your own hostname, I2P domain registrars such as <a href=http://stats.i2p/i2p/addkey.html target=_blank rel=noreferrer class=sitelink>stats.i2p</a> or <a href=http://reg.i2p/ target=_blank rel=noreferrer class=sitelink>reg.i2p</a> provide registration services that allow you to register and manage an .i2p hostname or sub-domain which will then be propagated across the network. Some registration sites will require the <i>B64 destination address</i> for the tunnel/service you wish to associate with a hostname, which you should copy from the <i>Local destination</i> section on the <a href='http://127.0.0.1:7657/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration page</a>.";
    t[2377] = "For at f\u00e5 dit eget v\u00e6rtsnavn, giver I2P-dom\u00e6neregistratorer som <a href=http://stats.i2p/i2p/addkey.html target=_blank rel=noreferrer class=sitelink>stats.i2p</a> eller <a href=http://reg.i2p/ target=_blank rel=noreferrer class=sitelink>reg.i2p</a> registreringstjenester, der tillader dig at registrere og administrere et .i2p v\u00e6rtsnavn eller underdom\u00e6ne, der derefter vil blive spredt p\u00e5 tv\u00e6rs af netv\u00e6rket. Nogle registreringssider vil kr\u00e6ve den <i>B64-destination-adresse</i> for tunnel/service, som du \u00f8nsker at forbinde med et v\u00e6rtsnavn, og som du skal kopiere fra afsnittet <i>Lokal destination</i> p\u00e5 <a href='http://127.0.0.1:7657/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration page</a>.";
