    t[2578] = "Many of the stats on the sidebar may be <a href='/configstats'>configured</a> to be <a href='/graphs'>graphed</a> for further analysis. You may also customize the sections that appear on the Sidebar and their positioning on the <a href='/configsidebar'>Sidebar Configuration page</a>.";
    t[2579] = "Mange af statistikkerne p\u00e5 sidepanelet kan <a href='/configstats'>konfigureres</a> til at blive <a href='/graphs'>grafisk fremstillet</a> til yderligere analyse. Du kan ogs\u00e5 tilpasse sektionerne, der vises p\u00e5 sidepanelet, og deres placering p\u00e5 <a href='/configsidebar'>konfigurationssiden til sidepanelet</a>.";
    t[2582] = "This tunnel-specific setting allows you to enable or disable replies to pings sent to servers hosted by the router. To disable pings, you must add the line <code>i2p.streaming.answerPings=false</code> to the <i>Custom Options</i> section for the server's configuration in the Tunnel Manager.";
    t[2583] = "Denne tunnelspecifikke indstilling giver dig mulighed for at aktivere eller deaktivere svar p\u00e5 pings, der sendes til servere hostet af routeren. For at deaktivere pinger, skal du tilf\u00f8je linjen <code>i2p.streaming.answerPings=false</code> i afsnittet <i>Custom Options</i> for serverens konfiguration i tunneladministratoren.";
