    t[2696] = "This setting (in seconds) allows you to override the delay between runs of the Peer Exploration Job which attempts to locate new peers to add to the NetDb. The job will run every 80 seconds by default, or if the router is experiencing job or message lag, every 3 minutes. If the size of the NetDb reaches 4000 peers, the pause will increase to 15 minutes. You may wish to increase the delay if your NetDb is well-populated (over 2000 peers), or if you wish to reduce overall bandwidth usage. Note: For Floodfill routers, this job does not run.";
    t[2697] = "Denne indstilling (i sekunder) giver dig mulighed for at tilsides\u00e6tte forsinkelsen mellem k\u00f8rslerne af Peer Exploration Job, som fors\u00f8ger at finde nye peers at tilf\u00f8je til NetDb. Jobbet vil k\u00f8re hver 80 sekunder som standard eller, hvis routeren oplever job eller meddelelses forsinkelser, hver 3. minut. Hvis st\u00f8rrelsen af NetDb n\u00e5r 4000 peers, vil pausen \u00f8ges til 15 minutter. Du kan \u00f8nske at \u00f8ge forsinkelsen, hvis din NetDb er godt fyldt op (over 2000 peers), eller hvis du \u00f8nsker at reducere den samlede b\u00e5ndbredde brug. Bem\u00e6rk: Denne job k\u00f8rer ikke for Floodfill routere.";
    t[2698] = "Current";
    t[2699] = "Aktuelt";
    t[2720] = "A website hosted on the I2P network. By default, a <a href=https://www.eclipse.org/jetty/about.html class='sitelink external' target=_blank rel=noreferrer>Jetty webserver</a> is configured and running on <a href=http://127.0.0.1:7658/ target=_blank rel=noreferrer>http://127.0.0.1:7658/</a>.";
    t[2721] = "En hjemmeside, der er hostet p\u00e5 I2P-netv\u00e6rket. Som standard er en <a href=https://www.eclipse.org/jetty/about.html class='sitelink external' target=_blank rel=noreferrer>Jetty-webserver</a> konfigureret og k\u00f8rer p\u00e5 <a href=http://127.0.0.1:7658/ target=_blank rel=noreferrer>http://127.0.0.1:7658/</a>.";
    t[2722] = "Can be disabled or changed in the <a href=/i2ptunnelmgr>Tunnel Manager</a>. Can also be configured to bind to a specific interface or all interfaces.";
    t[2723] = "Kan deaktiveres eller \u00e6ndres i <a href=/i2ptunnelmgr>Tunnel Manager</a>. Kan ogs\u00e5 konfigureres til at binde til en bestemt interface eller alle interfaces.";
