    t[2754] = "You may create a new router family here. Once you have created the family, you may export the family key file and share with other routers in your nominated family.";
    t[2755] = "Du kan oprette en ny routerfamilie her. N\u00e5r du har oprettet familien, kan du eksportere familiens n\u00f8glefil og dele med andre routere i din nominerede familie.";
