    t[2766] = "In order to access websites hosted on I2P, and optionally use the default outproxy to connect to websites on clearnet, you will need to configure your browser to use the I2P HTTP proxy, by default running on <code>127.0.0.1 port 4444</code>. Most browsers offer an option to configure your proxy; in this mini-tutorial we'll focus on Firefox.";
    t[2767] = "For at f\u00e5 adgang til websites hostet p\u00e5 I2P og eventuelt bruge standard-outprocyen til at forbinde til websites p\u00e5 clearnet, skal du konfigurere din browser til at bruge I2P HTTP-proxyen, som som standard k\u00f8rer p\u00e5 <code>127.0.0.1 port 4444</code>. De fleste browsere tilbyder en mulighed for at konfigurere din proxy; i denne mini-vejledning vil vi fokusere p\u00e5 Firefox.";
    t[2776] = "Close to us";
