    t[2796] = "Streaming radio service";
    t[2797] = "Streaming radiotjeneste";
    t[2798] = "I2P+ functions best when you can accurately reflect the speed of your network connection in the <a href=/config>bandwidth configuration section</a>. By default I2P+ is configured with some fairly conservative values that will not suit many use cases, so please take time to review these settings and correct where necessary. The more bandwidth you allocate, <i>specifically</i> upstream bandwidth, the more you will benefit from the network.";
    t[2799] = "I2P+ fungerer bedst, n\u00e5r du kan afspejle hastigheden p\u00e5 din netv\u00e6rksforbindelse n\u00f8jagtigt i <a href=/config>b\u00e5ndbreddekonfigurationssektionen</a>. Som standard er I2P+ konfigureret med nogle ret konservative v\u00e6rdier, der ikke passer til mange anvendelser, s\u00e5 tag dig venligst tid til at gennemg\u00e5 disse indstillinger og korrig\u00e9r, hvor det er n\u00f8dvendigt. Jo mere b\u00e5ndbredde du allokerer, <i>specifikt</i> opstr\u00f8ms b\u00e5ndbredde, jo mere vil du f\u00e5 gavn af netv\u00e6rket.";
