    t[2882] = "The I2P Network Protocol (I2NP) manages the routing and mixing of messages between routers, in addition to the transport selection (where more than one is supported) when communicating with a peer. For more information, see the <a href=https://geti2p.net/en/docs/protocol/i2np class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[2883] = "I2P Network Protocol (I2NP) administrerer routing og blanding af beskeder mellem routere samt valg af transport (hvor mere end \u00e9n er underst\u00f8ttet), n\u00e5r der kommunikeres med en peer. For mere information, se <a href=https://geti2p.net/en/docs/protocol/i2np class='sitelink external' target=_blank rel=noreferrer>online dokumentationen</a>.";
    t[2884] = "Expired {0} ago";
    t[2885] = "Udl\u00f8bet for {0} siden";
    t[2892] = "Your router's status on accepting or rejecting requests from other routers to build a participating tunnel through your router. Your router may accept all requests, accept or reject a percentage of requests, or reject all requests for a number of reasons, to control the bandwidth and CPU demands and maintain capacity for local clients. <b>Note";
    t[2893] = "Din routers status for at acceptere eller afvise anmodninger fra andre routere om at opbygge en deltager-tunnel gennem din router. Din router kan acceptere alle anmodninger, acceptere eller afvise en procentdel af anmodninger eller afvise alle anmodninger af flere \u00e5rsager for at kontrollere b\u00e5ndbredde- og CPU-kravene og opretholde kapacitet til lokale klienter. <b>Bem\u00e6rk";
    t[2902] = "Please contact a known trustworthy friend who has a running I2P router, and ask them for help with reseeding your I2P router. Request that they send you a reseed file exported from their running I2P router. It is vital that the file is exchanged over a secure channel, e.g. encrypted to avoid external tampering (PGP Sign, Encrypt and Verified with a trusted public key). The file itself is unsigned, so please accept files only from known trusted friends. Never import a reseed file if you cannot verify its source.";
    t[2903] = "Venligst kontakt en kendt og betroet ven, der har en k\u00f8rende I2P router, og bed dem om hj\u00e6lp til at gens\u00e5 din I2P router. Bed dem om at sende dig en gens\u00e5fil eksporteret fra deres k\u00f8rende I2P router. Det er vigtigt, at filen udveksles via en sikker kanal, f.eks. krypteret for at undg\u00e5 udefrakommende manipulation (PGP Sign\u00e9r, Krypt\u00e9r og Verificer med en betroet offentlig n\u00f8gle). Filen selv er ikke signeret, s\u00e5 accepter kun filer fra kendte betroede venner. Importer aldrig en gens\u00e5fil, hvis du ikke kan verificere dens kilde.";
    t[2916] = "Last Good Send";
    t[2917] = "Seneste gode afsending ";
