    t[2920] = "You can use a recorder in one tunnel that writes to a file that another tunnel, or multiple tunnels, can use for throttling. These files can also be edited by hand.";
    t[2921] = "Du kan bruge en optager i en tunnel, der skriver til en fil, som en anden tunnel eller flere tunneller kan bruge til d\u00e6mpning af hastigheden. Disse filer kan ogs\u00e5 redigeres manuelt.";
