    t[2956] = "The Java web applications listed below are started by the webConsole client and run in the same JVM as the router. They are usually web applications accessible through the router console. They may be complete applications (e.g. i2psnark), front-ends to another client or application which must be separately enabled (e.g. susidns, i2ptunnel), or have no web interface at all (e.g. addressbook).";
    t[2957] = "De Java-webapplikationer, der er angivet nedenfor, startes af webConsole-klienten og k\u00f8rer i samme JVM som routeren. De er normalt webapplikationer, der er tilg\u00e6ngelige gennem routerkonsollen. De kan v\u00e6re komplette applikationer (f.eks. i2psnark), frontender til en anden klient eller applikation, der skal aktiveres separat (f.eks. susidns, i2ptunnel), eller de kan ikke have en webgr\u00e6nseflade overhovedet (f.eks. addressbook).";
    t[2960] = "WARNING - Inbound 0-hop tunnels not recommended for hidden routers.";
