    t[2978] = "This is the total number of peers that are known by your router. They are listed on the <a href='/netdb'>Network Database page</a>. This may range from under 100 to 1000 or more. This number is not the total size of the network; it may vary widely depending on your total bandwidth, shared bandwidth, and locally-generated traffic. I2P does not require a router to know every other router in the network.";
    t[2979] = "Dette er det samlede antal peers, der er kendt af din router. De er opf\u00f8rt p\u00e5 <a href='/netdb'>Netv\u00e6rksdatabasen siden</a>. Dette kan variere fra under 100 til 1000 eller mere. Dette tal er ikke den totale st\u00f8rrelse af netv\u00e6rket; det kan variere meget afh\u00e6ngigt af din samlede b\u00e5ndbredde, delt b\u00e5ndbredde og lokalt genereret trafik. I2P kr\u00e6ver ikke, at en router kender alle andre routere i netv\u00e6rket.";
