    t[3062] = "You can override the <a href=http://127.0.0.1:7658/help/images/>default appearance</a> of the directory listing by supplying an edited <a href=http://127.0.0.1:7658/.resources/jetty-dir.css>jetty-dir.css</a> file to set a global appearance. Note that this file will not be displayed in the webserver's directory listing. Files and directories prefixed with . and files named favicon.ico or files ending with ~ or .bak or .old will also be hidden from view (though still accessible). Note: To create hidden files with a . prefix on Windows, add a trailing . to the file or directory e.g. <code>.hidden.</code>; Windows explorer will then save the file with the correct name, removing the trailing dot in the process.";
    t[3063] = "Du kan tilpasse det <a href=http://127.0.0.1:7658/help/images/>standardudseende</a> for mappelisten ved at levere en redigeret <a href=http://127.0.0.1:7658/.resources/jetty-dir.css>jetty-dir.css</a> fil for at indstille et globalt udseende. Bem\u00e6rk at denne fil ikke vil blive vist i webserverens mappeliste. Filer og mapper med pr\u00e6fikset . og filer navngivet favicon.ico eller filer der slutter med ~ eller .bak eller .old vil ogs\u00e5 v\u00e6re skjulte (men stadig tilg\u00e6ngelige). Bem\u00e6rk: For at oprette skjulte filer med en . pr\u00e6fiks i Windows, skal du tilf\u00f8je en prik i slutningen af filen eller mappen f.eks. <code>.hidden.</code>. Windows Explorer vil derefter gemme filen med det korrekte navn og fjerne den efterf\u00f8lgende prik i processen.";
