    t[3483] = "Denne indstilling bestemmer, om statistikker om vores ruter sporadisk offentligg\u00f8res p\u00e5 NetDb. [Standard er false]";
    t[3486] = "This is the number of peers your router has available for building client tunnels. It is generally in the range 8-30. Your fast peers are shown on the <a href='/profiles'>Profiles page</a>. <a href='/configstats#router.fastPeers'>[Enable graphing]</a>";
    t[3487] = "Dette er antallet af naboer din router har tilg\u00e6ngelige til at opbygge klienttunneler. Det er normalt i omr\u00e5det 8-30. Dine hurtige naboer vises p\u00e5 <a href='/profiles'>Profiler-siden</a>. <a href='/configstats#router.fastPeers'>[Aktiv\u00e9r graf]</a>";
    t[3488] = "Click the <i>Reseed from File</i> button";
    t[3489] = "Klik p\u00e5 knappen <i>Reseed fra fil</i>";
    t[3490] = "A variant of onion routing that encrypts multiple messages together to make it more difficult for attackers to perform traffic analysis and to increase the speed of data transfer. For more information, see the <a href=https://geti2p.net/en/docs/how/garlic-routing class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[3491] = "En variant af l\u00f8g-routing, der krypterer flere beskeder sammen for at g\u00f8re det sv\u00e6rere for angribere at udf\u00f8re trafikanalyse og for at \u00f8ge hastigheden p\u00e5 datatransmissionen. For mere information, se <a href=https://geti2p.net/en/docs/how/garlic-routing class='sitelink external' target=_blank rel=noreferrer>den online dokumentation</a>.";
    t[3494] = "How to Harden Your WordPress Site";
    t[3495] = "S\u00e5dan sikrer du din WordPress-side";
    t[3496] = "I2P Internals";
    t[3497] = "I2P Internt";
    t[3500] = "By default, I2P is supplied with a webserver to host your own anonymized website (traditionally referred to as an <i>eepsite</i>). Both the site and the I2P Router Console are running on a streamlined version of <a href='https://en.wikipedia.org/wiki/Jetty_(web_server)' target=_blank rel=noreferrer class='sitelink external'>Jetty</a>, customized for I2P.";
    t[3501] = "Som standard leveres I2P med en webserver til at hoste din egen anonymiserede hjemmeside (traditionelt kaldet en <i>eepsite</i>). B\u00e5de hjemmesiden og I2P Router Console k\u00f8rer p\u00e5 en specialudgave af <a href='https://en.wikipedia.org/wiki/Jetty_(web_server)' target=_blank rel=noreferrer class='sitelink external'>Jetty</a>, tilpasset til I2P.";
    t[3504] = "This setting allows you to exclude older routers from your NetDb. Routers older than the default or the value you set will be deleted from the NetDb and banned for the duration of the router session. By default, routers older than 0.9.20 are excluded. Note: starting with I2P+ version 0.9.46+, only routers running very recent versions are used for building local tunnels. [Restart required]";
    t[3505] = "Denne indstilling giver dig mulighed for at udelukke \u00e6ldre routere fra dit NetDb. Routere \u00e6ldre end standardv\u00e6rdien eller v\u00e6rdien, du angiver, vil blive slettet fra NetDb'en og forbudt for varigheden af router-sessionen. Som standard er routere \u00e6ldre end 0.9.20 ekskluderet. Bem\u00e6rk: Fra I2P+ version 0.9.46+ bruges kun routere, der k\u00f8rer meget nye versioner, til at opbygge lokale tunneler. [Genstart p\u00e5kr\u00e6vet]";
