    t[3624] = "This setting determines whether or not the router should use the provided <i>blocklist.txt</i> file and any user configured blocklists to enable banning of routers by hash or ip address. Ranges and net masks are supported for IPv4 but not IPv6. See the <i>blocklist.txt</i> in your I2P+ application directory for more info. [Enabled by default, restart required]";
    t[3625] = "Denne indstilling afg\u00f8r, om routeren skal bruge den medf\u00f8lgende <i>blocklist.txt</i> fil og eventuelle brugerdefinerede blocklister til at muligg\u00f8re forbud mod routere ved hash eller ip-adresse. Omr\u00e5der og netmasker underst\u00f8ttes for IPv4, men ikke IPv6. Se <i>blocklist.txt</i> i din I2P+ applikationsmappe for mere information. [Sl\u00e5et til som standard, genstart kr\u00e6vet]";
