    t[3638] = "Outbound UDP on port 123, allowing replies: this is necessary for I2P's internal time sync (via SNTP - querying a random SNTP host in <code>pool.ntp.org</code> or <a href=/help/advancedsettings#ntpserverconfig>another server you specify</a>).";
    t[3639] = "Udg\u00e5ende UDP p\u00e5 port 123, der tillader svar: dette er n\u00f8dvendigt for I2P's interne tidsynkronisering (via SNTP - foresp\u00f8rgsel mod en tilf\u00e6ldig SNTP-v\u00e6rt i <code>pool.ntp.org</code> eller <a href=/help/advancedsettings#ntpserverconfig>en anden server du specificerer</a>).";
