    t[3654] = "XChat-like client users can create a new network with the server <code>127.0.0.1/6668</code> (remember to tick <i>Bypass proxy server</i> if you have a proxy server configured), or you can connect with the command <code>/server 127.0.0.1 6668</code>. Different IRC clients may vary the syntax.";
    t[3655] = "Brugere af XChat-lignende klienter kan oprette et nyt netv\u00e6rk med serveren <code>127.0.0.1/6668</code> (husk at markere <i>Bypass proxy server</i> , hvis du har en proxyserver konfigureret), eller du kan oprette forbindelse med kommandoen <code>/server 127.0.0.1 6668</code>. Syntaxen for forskellige IRC-klienter kan variere.";
