    t[3704] = "The router configuration options listed below are not available in the user interface, usually because they are rarely used or provide access to advanced settings that most users will not need. This is not a comprehensive list. Some settings will require a restart of the router to take effect. Note that all settings are case sensitive. You will need to edit your <code>router.config</code> file to add options, or, once you have added <code>routerconsole.advanced=true</code> to the router.config file, you may edit settings within the console on the <a href=/configadvanced>Advanced Configuration page</a>.";
    t[3705] = "Nedenst\u00e5ende routerkonfigurationsoptioner er ikke tilg\u00e6ngelige i brugerfladen, normalt fordi de sj\u00e6ldent bruges eller giver adgang til avancerede indstillinger, som de fleste brugere ikke har brug for. Dette er ikke en omfattende liste. Nogle indstillinger kr\u00e6ver en genstart af routeren for at tr\u00e6de i kraft. Bem\u00e6rk, at alle indstillinger er f\u00f8lsomme over for store og sm\u00e5 bogstaver. Du skal redigere din <code>router.config</code>-fil for at tilf\u00f8je indstillinger, eller n\u00e5r du har tilf\u00f8jet <code>routerconsole.advanced=true</code> til router.config-filen, kan du redigere indstillingerne inde i konsollen p\u00e5 siden <a href=/configadvanced>Avanceret konfiguration</a>.";
