    t[3755] = "N\u00e5r denne er indstillet til sandt, vil din router ikke blive klassificeret som langsom, uanset specifikationerne for dit v\u00e6rtsystem. Normalt vil routere, der k\u00f8rer p\u00e5 v\u00e6rter med f\u00f8lgende karakteristika, blive klassificeret som langsomme, og forskellige performancerelaterede routerindstillinger vil blive \u00e6ndret i overensstemmelse hermed:";
