    t[3962] = "Some IRC clients are configured to disconnect from the server if there's been no communication with the server for a period of time, which can sometimes be problematic for I2P IRC if the <i>ping timeout</i> value is set too low. Setting the ping timeout value in your client to a high value (e.g. 320 seconds) will often result in a more robust connection to the network. In hexchat you can configure the value by typing <code>/set net_ping_timeout 320</code>. This will write the value to your <code>hexchat.conf</code> file.";
    t[3963] = "Nogle IRC-klienter er konfigureret til at afbryde forbindelsen til serveren, hvis der ikke har v\u00e6ret nogen kommunikation med serveren i et stykke tid, hvilket kan v\u00e6re problematisk for I2P IRC, hvis v\u00e6rdien for <i>ping timeout</i> er indstillet for lavt. Hvis du indstiller ping timeout-v\u00e6rdien i din klient til en h\u00f8j v\u00e6rdi (f.eks. 320 sekunder), vil det ofte resultere i en mere p\u00e5lidelig forbindelse til netv\u00e6rket. I hexchat kan du konfigurere v\u00e6rdien ved at skrive <code>/set net_ping_timeout 320</code>. Dette vil skrive v\u00e6rdien til din <code>hexchat.conf</code>-fil.";
    t[3964] = "Run at Startup?";
    t[3965] = "K\u00f8r ved opstart?";
    t[3972] = "Never";
    t[3973] = "Aldrig";
    t[3978] = "An <a href=/confignet#ipchange>optional configuration</a> that automatically changes your <a href=/netdb?r=.>router identity</a> and <a href=/confignet#udpconfig>external port</a> when the public ip address your system is on changes. This can prevent an adversary from correlating your router identity and ip address in scenarios where your ip address may change frequently, for example when you're running I2P on a laptop from multiple locations.";
    t[3979] = "En <a href=/confignet#ipchange>valgfri konfiguration</a>, der automatisk \u00e6ndrer din <a href=/netdb?r=.>routers identitet</a> og <a href=/confignet#udpconfig>ekstern port</a>, n\u00e5r den offentlige ip-adresse p\u00e5 dit system \u00e6ndres. Dette kan forhindre en modstander i at korrelere din routers identitet og ip-adresse i situationer, hvor din ip-adresse kan \u00e6ndre sig hyppigt, for eksempel n\u00e5r du k\u00f8rer I2P p\u00e5 en b\u00e6rbar computer fra forskellige steder.";
    t[3982] = "The router is not configured to publish its address, therefore it does not expect incoming connections.";
    t[3983] = "Routeren er ikke konfigureret til at udgive dens adresse, derfor forventer den ikke indkommende forbindelser";
    t[3998] = "A command-line application supplied with I2P+ (Linux/MacOS) that is used to perform a <code>head</code> request on a specified http resource on the network, returning various response headers from the remote server. By default, eephead uses the HTTP proxy on <code>127.0.0.1:4444</code>.";
    t[3999] = "En kommandolinje-applikation, der medf\u00f8lger I2P+ (Linux/MacOS) og bruges til at udf\u00f8re en <code>head</code>-foresp\u00f8rgsel p\u00e5 en specificeret http-ressource p\u00e5 netv\u00e6rket og returnere forskellige svarhoveder fra den fjerntliggende server. Som standard bruger eephead HTTP-proxyen p\u00e5 <code>127.0.0.1:4444</code>.";
