    t[4332] = "Note: The order of the declarations matters. The first threshold declaration for a given destination (whether explicit or listed in a referenced file) overrides any future thresholds for the same destination, whether explicit or listed in a file. Note: to apply a new filter file, the tunnel must be restarted after the location has been specified in the tunnel manager. Once configured, a definition file can be updated without requiring a restart of the target tunnel, although destinations that are blocked will persist until the tunnel is restarted.";
    t[4333] = "Bem\u00e6rk: R\u00e6kkef\u00f8lgen af \u200b\u200berkl\u00e6ringerne er vigtig. Den f\u00f8rste t\u00e6rskel erkl\u00e6ring for et givet bestemmelsessted (uanset om den er ekspliit eller opf\u00f8rt i en henvisningsfil) tilsides\u00e6tter eventuelle fremtidige t\u00e6rskler for samme bestemmelsessted, uanset om de er ekspliit eller opf\u00f8rt i en fil. Bem\u00e6rk: For at anvende en ny filterfil skal tunnelen genstartes efter at placeringen er angivet i tunnelmanageren. N\u00e5r det er konfigureret, kan en definitionsfil opdateres uden at kr\u00e6ve en genstart af m\u00e5ltunnelen, selvom blokerede bestemmelsessteder vil blive vedvarende, indtil tunnelen genstartes.";
