    t[4702] = "NTCP (NIO-based TCP) and NTCP2 are TCP-based network transports which use Java's NIO (New I/O) TCP implementation to deliver I2NP messages between routers on the network. NTCP2 improves the resistance of NTCP to various attacks and automated traffic identification methods. For more information, see the <a href=https://geti2p.net/en/docs/transport/ntcp class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[4703] = "NTCP (NIO-baseret TCP) og NTCP2 er TCP-baserede netv\u00e6rkstransporter, der bruger Javas NIO (New I/O) TCP-implementering til at levere I2NP-meddelelser mellem routere p\u00e5 netv\u00e6rket. NTCP2 forbedrer modstanden af NTCP mod forskellige angreb og automatiske trafikidentifikationsmetoder. For mere information, se <a href=https://geti2p.net/en/docs/transport/ntcp class='sitelink external' target=_blank rel=noreferrer>onlinedokumentationen</a>.";
    t[4708] = "You can use a recorder to log the destinations of aggressive clients to a specified file, and then use that same file to throttle them. The following snippet defines a filter that initially allows all connection requests, but if any single destination exceeds 180 requests in 60 seconds, it gets throttled down to 30 requests every 60 seconds:";
    t[4709] = "Du kan bruge en optager til at logge aggressive klients destinationer til en angivet fil og derefter bruge den samme fil til at regulere dem. F\u00f8lgende uddrag definerer en filter, der i f\u00f8rste omgang tillader alle forbindelsesanmodninger, men hvis en enkelt destination overskrider 180 anmodninger p\u00e5 60 sekunder, s\u00e6nkes det til 30 anmodninger hvert 60. sekund:";
