    t[4932] = "I2P+ supports custom theme overrides for the console, the tunnel manager, I2PSnark, SusiDNS and Susimail, permitting changes to the themes which are persistent after upgrades. In order to activate an override, create a css file named <code>override.css</code> with your theme modifications and place it in the relevant theme directory of the theme you wish to change, or rename one of the example files, and then hard refresh the browser. Note that the tunnel manager and the console share the same override.css. To deactivate an override, delete or rename the <code>override.css</code> file and then hard refresh the browser (usually Control + Shift + R).";
    t[4933] = "I2P+ underst\u00f8tter brugerdefinerede temaovers\u00e6ttelser til konsollen, tunnelh\u00e5ndteringen, I2PSnark, SusiDNS og Susimail, hvilket tillader \u00e6ndringer i temaer, der er vedvarende efter opgraderinger. For at aktivere en overs\u00e6ttelse, skal du oprette en CSS-fil, der hedder <code> override.css </code> med dine temamodifikationer og placere den i den relevante tema-mappe p\u00e5 det tema, du \u00f8nsker at \u00e6ndre, eller omd\u00f8be en af de eksempelfiler og derefter hardopdater browseren. Bem\u00e6rk, at tunnelh\u00e5ndteringen og konsollen deler samme override.css. For at deaktivere en overs\u00e6ttelse skal du slette eller omd\u00f8be filen <code> override.css </code> og derefter hardopdater din browser (normalt Control + Shift + R).";
