    t[5042] = "When set to true, this setting enables reverse DNS lookups for peers, triggered when displaying the country flag of a peer or when the hostname or domain is explicitly displayed in the console, or when the peer's RouterInfo is written to disk. In order to avoid repeat lookups, it's recommended to configure a generous caching policy for DNS lookups of 10 minutes or more, and to configure a privacy respecting DNS server in your operating system. [Disabled by default, restart required]";
    t[5043] = "N\u00e5r denne indstilling er aktiveret, tillader den omvendt DNS-opslag for j\u00e6vnaldrende, der udl\u00f8ses, n\u00e5r nationalflaget for en j\u00e6vnaldrende vises, eller n\u00e5r v\u00e6rtsnavnet eller dom\u00e6net vises eksplicit i konsollen, eller n\u00e5r j\u00e6vnaldrendes RouterInfo skrives til disk. For at undg\u00e5 gentagne opslag anbefales det at konfigurere en gener\u00f8s cachelagring af DNS-opslag p\u00e5 10 minutter eller l\u00e6ngere og konfigurere en DNS-server der respekterer beskyttelse af privatlivet p\u00e5 dit operativsystem. [Deaktiveret som standard, genstart p\u00e5kr\u00e6vet]";
