    t[5084] = "If you're running a dynamic site handling a large number of concurrent users, content caching can often improve the time taken to deliver pages. For content that rapidly changes, a <a href=https://blog.stackpath.com/glossary-micro-caching/ target=_blank class='sitelink external'>micro-caching strategy</a> may still yield some benefits. The <a href=https://www.nginx.com/ target=_blank class='sitelink external'>Nginx webserver</a> provides a competent caching sub-system, or for a more heavy-weight solution, have a look at <a href=https://varnish-cache.org/ target=_blank class='sitelink external'>Varnish</a>.";
    t[5085] = "Hvis du k\u00f8rer en dynamisk side, der h\u00e5ndterer et stort antal samtidige brugere, kan indholdscaching ofte forbedre den tid det tager at levere sider. For indhold, der \u00e6ndres hurtigt, kan en <a href=https://blog.stackpath.com/glossary-micro-caching/ target=_blank class='sitelink external'>micro-caching strategi</a> stadig medf\u00f8re visse fordele. <a href=https://www.nginx.com/ target=_blank class='sitelink external'>Nginx webserveren</a> giver et kompetent caching delsystem, eller for en mere avanceret l\u00f8sning, kan du se p\u00e5 <a href=https://varnish-cache.org/ target=_blank class='sitelink external'>Varnish</a>.";
