    t[5514] = "If after a few minutes of uptime your router is indicating 0 Active Peers and 0 Known Peers, with a notification in the sidebar that you need to check your network connection, verify that you can access the internet. If your internet connection is functional, you may need to unblock Java in your firewall. Otherwise, you may need to reseed your I2P router. Visit the <a href=/configreseed#reseedconfig>Reseed Configuration page</a> and click the <i>Save Changes and Reseed Now</i> button. For more information, see the <a href=#reseedhelp>Reseed help section</a> above.";
    t[5515] = "Hvis din router efter et par minutters uptime viser 0 aktive samarbejdspartnere og 0 kendte samarbejdspartnere med en notifikation p\u00e5 sidepanelet om, at du skal kontrollere din netv\u00e6rksforbindelse, skal du kontrollere, om du har adgang til internettet. Hvis din internetforbindelse fungerer, skal du muligvis fjerne blokeringen af Java i din firewall. Ellers skal du m\u00e5ske genoprette forbindelsen til din I2P-router. Bes\u00f8g siden for <a href=/configreseed#reseedconfig>Genopret konfigurationside</a> og klik p\u00e5 knappen <i>Gem \u00e6ndringer og genopret nu</i>. For mere information, se afsnittet om <a href=#reseedhelp>hj\u00e6lp til genopretning</a> ovenfor.";
    t[5518] = "A higher level socket API for clients. Only opened when a SAM V3 client requests a UDP session. Can be enabled/disabled on the <a href=/configclients> Client Configuration page</a>. Can be changed in the <code>clients.config</code> file with the SAM command line option <code>sam.udp.port=nnnn</code>.";
    t[5519] = "En h\u00f8jniveau socket API til klienter. Bliver kun \u00e5bnet, n\u00e5r en SAM V3 klient anmoder om en UDP-session. Kan aktiveres/deaktiveres p\u00e5 <a href=/configclients> Klientkonfigurationssiden</a>. Kan \u00e6ndres i <code>clients.config</code> filen med SAM kommandolinjeindstillingen <code>sam.udp.port=nnnn</code>.";
    t[5526] = "If you want your site to feel responsive, image compression is essential when hosting large images. Using a service like <a href=https://tinypng.com/ target=_blank class='sitelink external'>tinypng.com</a> to compress your png and jpeg images will often result in much smaller files with minimal loss of quality. In some situations the webp format can best jpegs, generating smaller files with approximately the same or better visual fidelity, and has wide browser support. Also consider using svgs instead of bitmaps for icons and illustrations - they're often smaller than the equivalent bitmap file (run them through a service like <a href=https://vecta.io/nano target=_blank class='sitelink external'>Nano SVG Optimizer</a> to remove unneeded cruft), scale without loss of quality, and can be gzipped by your webserver.";
    t[5527] = "Hvis du \u00f8nsker, at dit websted skal f\u00f8les responsivt, er komprimering af billeder afg\u00f8rende, n\u00e5r du hoster store billeder. Brug af en service som <a href=https://tinypng.com/ target=_blank class='sitelink external'>tinypng.com</a> til at komprimere dine png- og jpeg-billeder vil ofte resultere i meget mindre filer med minimal tab af kvalitet. I nogle situationer kan webp-formatet erstatte jpegs og generere mindre filer med cirka samme eller bedre visuel kvalitet og har bred browservisning. Overvej ogs\u00e5 at bruge svgs i stedet for bitmaps til ikoner og illustrationer - de er ofte mindre end den tilsvarende bitmap-fil (k\u00f8r dem gennem en service som <a href=https://vecta.io/nano target=_blank class='sitelink external'>Nano SVG Optimizer</a> for at fjerne un\u00f8dvendigt overfl\u00f8digt materiale), skalerer uden tab af kvalitet og kan komprimeres af din webserver.";
    t[5528] = "UPnP disabled on the device";
    t[5529] = "UPnP er sl\u00e5et fra p\u00e5 enheden";
    t[5536] = "By default, most of your client services (mail, http proxy, IRC) will share the same set of tunnels (for performance reasons) and be listed as <i>Shared Clients</i> and <i>Shared Clients(DSA)</i> in the sidebar under Service Tunnels and on the <a href=/tunnels>Tunnels page</a>.";
    t[5537] = "Som standard vil de fleste af dine klienttjenester (mail, http-proxy, IRC) dele den samme s\u00e6t tunneler (af hensyn til ydeevnen) og vises som <i>Delt klient</i> og <i>Delt klient(DSA)</i> i sidepanelet under tjenestetunneler og p\u00e5 siden <a href=/tunnels>Tunneler</a>.";
