    t[5544] = "This section is not enabled by default unless <a href='/help/configuration#advancedconsole'>Advanced Console mode</a> is enabled. You may enable it on the <a href='/configsidebar'>Sidebar Configuration page</a>.";
    t[5545] = "Denne sektion er ikke aktiveret som standard, medmindre <a href='/help/configuration#advancedconsole'>Avanceret konsoltilstand</a> er aktiveret. Du kan aktivere det p\u00e5 siden <a href='/configsidebar'>Konfiguration i sidepanelet</a>.";
