    t[5681] = "Konfigurer I2P-systemtjeneste";
    t[5684] = "Check to see if another program is using the configured port. If so, stop that program or configure I2P to use a different port.";
    t[5685] = "Tjek og se om et andet program bruger den konefigureret port. Hvis der er det, stop det program eller konfigurer I2P til at bruge en anden port.";
    t[5692] = "Manually edit peers and view banned peers and blocklist";
