    t[5712] = "Firewalled with Inbound TCP Enabled";
    t[5713] = "Firewalled med indg\u00e5ende TCP aktiveret";
    t[5716] = "Open <a href=/confignet#udpconfig>I2P+'s port</a> on your modem, router and/or firewall(s) for better connectivity (ideally both UDP and TCP). More information on how to go about port forwarding can be found at <a href=http://portforward.com/ target=_blank rel=noreferrer class='sitelink external'>portforward.com</a>, in addition to our forums and IRC channels listed below. Note that I2P does not support connecting to the internet via an http or socks proxy [patches welcome!], though you can connect to proxies via I2P itself once connected to the network.";
    t[5717] = "\u00c5bn <a href=/confignet#udpconfig>I2P+'s port</a> p\u00e5 din modem, router og/eller firewall(er) for en bedre forbindelse (ideelt set b\u00e5de UDP og TCP). Du kan finde flere oplysninger om, hvordan du g\u00f8r portforwarding, p\u00e5 <a href=http://portforward.com/ target=_blank rel=noreferrer class='sitelink external'>portforward.com</a>, udover vores forum og IRC kanaler, der er angivet nedenfor. Bem\u00e6rk, at I2P ikke underst\u00f8tter forbindelse til internettet via en http eller socks proxy [patches velkomne!], men du kan oprette forbindelse til proxies via I2P selv, n\u00e5r du er tilsluttet netv\u00e6rket.";
    t[5730] = "A tunnel filter can provide protection against denial of service attacks, without otherwise interrupting the service for genuine users, either in conjunction with the tunnel throttler or as an alternative strategy. It can also be used to log access to a hosted service to determine if the server is under attack, or simply to log all visitors by I2P destination. Additionally, a filter can function simultaneously as a whitelist and blacklist making it more flexible than the Tunnel Manager's access list controls. Note that multiple server tunnels can share a single filter file if you wish to implement a global filter.";
    t[5731] = "En tunnel filtrering kan give beskyttelse mod denial of service-angreb, uden at afbryde servicen for legitime brugere, enten i sammenh\u00e6ng med tunnels throttler eller som en alternativ strategi. Det kan ogs\u00e5 bruges til at logge adgang til en hosted service for at afg\u00f8re, om serveren er under angreb eller simpelthen at logge alle bes\u00f8gende efter I2P destination. Derudover kan en filter fungere som en whitelist og blacklist samtidig og g\u00f8re det mere fleksibelt end Tunnel Managerens adgangskontrol. Bem\u00e6rk, at flere servertunneler kan dele en enkelt filterfil, hvis du \u00f8nsker at implementere en global filtrering.";
