    t[6026] = "This setting (in milliseconds) allows you to manually configure the delay between router refresh updates run by the Refresh Routers Job. By default the pause between refreshes is determined by the size of the NetDb, and introduces some randomness in the timing to mitigate traffic analysis. For values lower than 2000 milliseconds, increasing the value of <code>router.refreshTimeout</code> is recommended. Note that setting this value below 2000 milliseconds will increase your network traffic and may introduce job lag, and is not recommended for sustained use.";
    t[6027] = "Denne indstilling (i millisekunder) giver dig mulighed for manuelt at konfigurere forsinkelsen mellem opdateringerne af routernes opdatering, der k\u00f8res af jobbet Refresh Routers. Som standard bestemmes pausen mellem opdateringerne af st\u00f8rrelsen af NetDb og introducerer noget tilf\u00e6ldighed i timingen for at begr\u00e6nse trafikanalysen. For v\u00e6rdier mindre end 2000 millisekunder anbefales det at \u00f8ge v\u00e6rdien af <code>router.refreshTimeout</code>. Bem\u00e6rk, at indstilling af denne v\u00e6rdi under 2000 millisekunder vil \u00f8ge din netv\u00e6rkstrafik og kan medf\u00f8re jobforsinkelser og anbefales ikke til vedvarende brug.";
    t[6030] = "Server tunnels, configurable in the <a href=/i2ptunnelmgr>Tunnel Manager</a>, provide a number of ways to limit access to the hosted service. Destination whitelisting, blacklisting, connection throttling, and tunnel filtering are methods provisioned to mitigate denial of service attacks, grant exclusive access to known I2P destinations, and manage traffic to the server.";
    t[6031] = "Servertunneller, som kan konfigureres i <a href=/i2ptunnelmgr> Tunnel Manager </a>, giver en r\u00e6kke m\u00e5der til begr\u00e6nse adgangen til den hosted service. Destination hvidliste, sortliste, forbindelsestyring og tunnelfiltrering er metoder, der er udlagt til at afb\u00f8de denial of service-angreb, give eksklusiv adgang til kendte I2P-destinationer og administrere trafikken til serveren.";
