    t[6350] = "This setting determines the number of peers to explore in parallel when the Peer Exploration Job runs [default is 1 peer at a time when more than 3000 peers are known]. Note that increasing this value will increase the bandwidth requirements for the exploration, and setting this value too high may cause excessive message delay and interfere with other services, so use with caution!";
    t[6351] = "Denne indstilling bestemmer antallet af peere, der skal udforskes parallelt, n\u00e5r Peer Exploration Job k\u00f8res [standard er 1 peer ad gangen, n\u00e5r der er kendt mere end 3000 peere]. Bem\u00e6rk, at \u00f8gning af denne v\u00e6rdi vil \u00f8ge b\u00e5ndbreddekravene til udforskningen, og hvis denne v\u00e6rdi indstilles for h\u00f8jt, kan det medf\u00f8re overdreven beskedforsinkelse og forstyrre andre tjenester, s\u00e5 brug den med forsigtighed!";
