    t[6376] = "If the skew is more than a few seconds, please correct the problem by adjusting your computer's time.";
    t[6377] = "Hvis forskydningen er mere end et par sekunder, skal du rette problemet ved at justere din computers tid.";
    t[6382] = "Note: To enhance your security when browsing .i2p sites, you may wish to consider installing an addon to prevent Javascript from running in the browser such as <a href=https://addons.mozilla.org/en-US/firefox/addon/noscript/ target=_blank rel=noreferrer class='sitelink external'>NoScript</a>, though it's recommended to whitelist the address I2P+ is running on to enable various router console enhancements. In addition, an addon that prevents requests to offsite resources is also recommended, for example <a href=https://addons.mozilla.org/en-US/firefox/addon/umatrix/ target=_blank rel=noreferrer class='sitelink external'>uMatrix</a>.";
    t[6383] = "Bem\u00e6rk: For at forbedre din sikkerhed, n\u00e5r du browser .i2p-websteder, kan du overveje at installere en tilf\u00f8jelse, der forhindrer JavaScript i at k\u00f8re i browseren, som f.eks. <a href=https://addons.mozilla.org/en-US/firefox/addon/noscript/ target=_blank rel=noreferrer class='sitelink external'>NoScript</a>, selvom det anbefales at tilf\u00f8je adressen I2P+ k\u00f8rer p\u00e5 til hvidlisten for at aktivere forskellige router konsol-udvidelser. Derudover anbefales det ogs\u00e5 at installere en tilf\u00f8jelse, der forhindrer anmodninger til ressourcer fra andre websteder, f.eks. <a href=https://addons.mozilla.org/en-US/firefox/addon/umatrix/ target=_blank rel=noreferrer class='sitelink external'>uMatrix</a>.";
