    t[6762] = "I2P+ may be slow to integrate into network the first time you run it as it bootstraps into the network and learns of additional peers. The longer your I2P+ router is running, the better it will perform, so try and keep your router on as long as you can, 24/7 if possible! If, after 30 minutes, your <i>Active: [connected/recent]</i> count still has less than 10 peers, or your total number of <i>Integrated</i> peers is less than 5, there are several things you can do to check for problems:";
    t[6763] = "I2P+ kan v\u00e6re langsom til at integrere i netv\u00e6rket f\u00f8rste gang, du k\u00f8rer det, da det bootstrapper ind i netv\u00e6rket og l\u00e6rer om yderligere peers. Jo l\u00e6ngere din I2P+ router k\u00f8rer, desto bedre vil den pr\u00e6stere, s\u00e5 pr\u00f8v at holde din router t\u00e6ndt s\u00e5 l\u00e6nge som muligt, 24/7 hvis det er muligt! Hvis, efter 30 minutter, din <i>Aktiv: [connected/recent]</i> t\u00e6ller stadig har f\u00e6rre end 10 peers, eller dit samlede antal <i>Integrerede</i> peere er mindre end 5, er der flere ting, du kan g\u00f8re for at kontrollere for problemer:";
