    t[6944] = "A java implementation of a Tor client, available as an I2P plugin. Can be used as the default <i>outproxy</i> if configured in the relevant SOCKS or HTTP client tunnel in the <i>Tunnel Manager</i>. Available from <a href=http://stats.i2p/i2p/plugins class=sitelink>http://stats.i2p/i2p/plugins</a>. Source code is available on <a href=https://github.com/i2p/i2p.plugins.orchid class='sitelink external' target=_blank rel=noreferrer>github</a>.";
    t[6945] = "En Java-implementering af en Tor-klient, tilg\u00e6ngelig som en I2P-plugin. Kan bruges som standard <i>udproxy</i>, hvis det er konfigureret i den relevante SOCKS- eller HTTP-klienttunnel i <i>Tunnel Manager</i>. Tilg\u00e6ngelig fra <a href=http://stats.i2p/i2p/plugins class=sitelink>http://stats.i2p/i2p/plugins</a>. Kildekode er tilg\u00e6ngelig p\u00e5 <a href=https://github.com/i2p/i2p.plugins.orchid class='sitelink external' target=_blank rel=noreferrer>github</a>.";
    t[6952] = "IPv4 Addresses";
    t[6953] = "IPv4-adresser";
    t[6956] = "This section indicates your average bandwidth speeds and total usage for the session. All values are in bytes per second. You may change your bandwidth limits on the <a href='/config'>Bandwidth Configuration page</a>. The more bandwidth you make available, the more you help the network and improve your own anonymity, so please take the time to review the settings. If you are unsure of your network's speed, using a service such as <a href='http://speedtest.net/'>SpeedTest</a> or similar will give you a good indication of your bandwidth capability. Your upstream share amount (KBps Out) will determine your overall contribution to the network. Bandwidth is <a href='/graphs'>graphed</a> by default.";
    t[6957] = "Denne sektion angiver dine gennemsnitlige b\u00e5ndbreddehastigheder og samlet forbrug for sessionen. Alle v\u00e6rdier angives i bytes pr. sekund. Du kan \u00e6ndre dine b\u00e5ndbreddebegr\u00e6nsninger p\u00e5 <a href='/config'>B\u00e5ndbreddekonfigurationssiden</a>. Jo mere b\u00e5ndbredde du stiller til r\u00e5dighed, jo mere hj\u00e6lper du netv\u00e6rket og forbedrer din egen anonymitet, s\u00e5 brug venligst tid p\u00e5 at gennemg\u00e5 indstillingerne. Hvis du er usikker p\u00e5 dit netv\u00e6rks hastighed, kan du bruge en tjeneste som f.eks. <a href='http://speedtest.net/'>SpeedTest</a> eller lignende for at f\u00e5 en god indikation af din b\u00e5ndbreddekapacitet. Din upstream del (KBps Ud) vil bestemme dit samlede bidrag til netv\u00e6rket. B\u00e5ndbredde er som standard <a href='/graphs'>grafisk</a>.";
