    t[7004] = "This setting allows you to configure the minimum number of hosted participating tunnels before the router starts to reject tunnel requests based on anticipated bandwidth requirements. [Default is 100 if system is running Android, 800 if system is running on ARM and less than 4 cores available, 1200 if system is running on ARM and 4 or more cores available, otherwise 2500]";
    t[7005] = "Denne indstilling giver dig mulighed for at konfigurere det mindste antal deltagende tunneler, f\u00f8r routeren begynder at afvise tunnelanmodninger baseret p\u00e5 forventet b\u00e5ndbreddebehov. [Standardv\u00e6rdien er 100, hvis systemet k\u00f8rer Android, 800, hvis systemet k\u00f8rer p\u00e5 ARM og der er mindre end 4 kerner tilg\u00e6ngelige, 1200 hvis systemet k\u00f8rer p\u00e5 ARM og der er 4 eller flere kerner tilg\u00e6ngelige, ellers 2500]";
