    t[7158] = "I2P does not work well behind this type of firewall. You will probably not be able to accept inbound connections, which will limit your participation in the network.";
    t[7159] = "I2P fungerer ikke s\u00e6rlig godt bag denne type firewall. Du vil h\u00f8jst sandsynligt ikke have mulighed for at accepterer indadg\u00e5ende forbindelser, hvilket vil begr\u00e6nse din deltagelse i netv\u00e6rket.";
    t[7166] = "The I2P Client Protocol (I2CP) enables external applications (clients) to communicate with I2P over single TCP socket, by default using port 7654. For more information, see the <a href=https://geti2p.net/en/docs/protocol/i2cp class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[7167] = "I2P Client Protocol (I2CP) giver eksterne applikationer (klienter) mulighed for at kommunikere med I2P via en enkelt TCP-socket, som standard ved brug af port 7654. For mere information, se <a href=https://geti2p.net/en/docs/protocol/i2cp class='sitelink external' target=_blank rel=noreferrer>online dokumentationen</a>.";
    t[7168] = "Queue Totals";
    t[7169] = "K\u00f8totaler";
    t[7170] = "This setting determines which transport takes priority when communicating with peers. By default, NTCP is favored over UDP (SSU). By setting the value to true, UDP will be favored unless a pre-existing NTCP connection exists; when set to always, UDP will always be used regardless of any pre-existing NTCP connection. [Default is false]";
    t[7171] = "Denne indstilling afg\u00f8r hvilken transport der prioriteres ved kommunikation med peers. Som standard v\u00e6lges NTCP frem for UDP (SSU). Ved at s\u00e6tte v\u00e6rdien til true vil UDP blive prioriteret, medmindre der findes en eksisterende NTCP-forbindelse; n\u00e5r v\u00e6rdien s\u00e6ttes til always, vil UDP altid blive brugt uanset eventuelle eksisterende NTCP-forbindelser. [Standardv\u00e6rdien er false]";
