    t[7285] = "De indsamlede data er kvantiseret over en periode p\u00e5 1 minut, og skal derfor blot betragtes som et sk\u00f8n.";
    t[7292] = "When set to true, I2P runs without network connectivity, which is helpful if you are constantly restarting the router to test code updates as this prevents network disruption.";
    t[7293] = "N\u00e5r denne indstilling er sat til true, k\u00f8rer I2P uden netv\u00e6rksforbindelse, hvilket er nyttigt, hvis du konstant genstarter routeren for at teste kodeopdateringer, da det forhindrer netv\u00e6rksafbrydelser.";
    t[7302] = "Updating IP address";
    t[7303] = "Opdatere IP adresse";
    t[7308] = "SSU [IPv6 Only] with Introducers";
    t[7309] = "IPv6 kun SSU, introducers";
    t[7312] = "SSU (Secure Semi-reliable UDP) is an I2P network transport providing encrypted, connection-oriented, point-to-point connections, in addition to IP address detection and NAT traversal services. For more information, see the <a href=https://geti2p.net/en/docs/transport/ssu class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[7313] = "SSU (Secure Semi-reliable UDP) er en I2P-netv\u00e6rkstransport, der giver krypterede, forbindelsesorienterede, punkt-til-punkt-forbindelser samt IP-adresse-detektion og NAT-traversal-tjenester. For mere information, se <a href=https://geti2p.net/en/docs/transport/ssu class='sitelink external' target=_blank rel=noreferrer>online-dokumentationen</a>.";
    t[7314] = "Congestion window";
    t[7315] = "Overbelastningsvindue";
    t[7326] = "Use Proxy to Reseed";
    t[7327] = "Brug proxy til at gense";
    t[7328] = "Until the advent of I2P integration in <a href=http://www.vuze.com/ target=_blank rel=noreferrer class='sitelink external'>Vuze</a>, it wasn't possible to download torrents that weren't hosted on the I2P network. However, now that Vuze (and latterly <a href=https://www.biglybt.com/ target=_blank rel=noreferrer class='sitelink external'>Bigly</a>) allow users to share non-I2P torrents on I2P, non-I2P torrents can be downloaded over I2P if Vuze/Bigly users have chosen to make content available to the I2P network. Popular torrents with a large number of peers are more likely to be accessible via I2P; to determine if the content is available, add the torrent link, magnet or infohash to your I2P-enabled BitTorrent client.";
    t[7329] = "Indtil introduktionen af I2P integrationen i <a href=http://www.vuze.com/ target=_blank rel=noreferrer class='sitelink external'>Vuze</a>, var det ikke muligt at downloade torrents, der ikke var hostet p\u00e5 I2P-netv\u00e6rket. Men nu hvor Vuze (og senest <a href=https://www.biglybt.com/ target=_blank rel=noreferrer class='sitelink external'>Bigly</a>) tillader brugere at dele ikke-I2P torrents p\u00e5 I2P, kan ikke-I2P torrents downloades via I2P, hvis Vuze/Bigly brugere har valgt at g\u00f8re indholdet tilg\u00e6ngeligt for I2P-netv\u00e6rket. Popul\u00e6re torrents med et stort antal brugere er mere tilg\u00e6ngelige via I2P; for at afg\u00f8re om indholdet er tilg\u00e6ngeligt, tilf\u00f8j torrent-linket, magneten eller infohashen til din I2P-aktiverede BitTorrent-klient.";
