    t[7429] = "Denne indstilling (i timer) bestemmer, hvor gammel en RouterInfo er i NetDb (dens seneste kendte offentligg\u00f8relsesdato) f\u00f8r den klassificeres som for\u00e6ldet og slettes. [Standard er 28 timer, medmindre routeren er en Floodfill, i hvilket tilf\u00e6lde standarden er 8 timer]";
