    t[7443] = "Router Hj\u00e6lp og FAQ";
    t[7444] = "If a <i>Registration Authentication</i> string is requested, you can find it on the <a href='http://127.0.0.1:7657/i2ptunnel/register?tunnel=3'>Registration Authentication page</a> linked from the <a href='http://127.0.0.1:7657/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration page</a>. Registration authentication ensures only the owner is able to register or otherwise manage the hostname, and is required on stats.i2p and reg.i2p.";
    t[7445] = "Hvis en <i>Registreringsgodkendelse</i> foresp\u00f8rgsel anmodes, kan du finde den p\u00e5 <a href='http://127.0.0.1:7657/i2ptunnel/register?tunnel=3'>Registreringsgodkendelsessiden</a> som er linket fra <a href='http://127.0.0.1:7657/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration page</a>. Registreringsgodkendelse sikrer, at kun ejeren kan registrere eller p\u00e5 anden m\u00e5de administrere v\u00e6rtsnavnet, og dette er p\u00e5kr\u00e6vet p\u00e5 stats.i2p og reg.i2p.";
    t[7448] = "News &amp; Updates";
    t[7449] = "Nyheder &amps; Opdateringer";
    t[7452] = "[Linux/Unix/Solaris] If you can't start the router with <code>i2p/i2prouter start</code> try the <code>runplain.sh</code> script in the same directory. Root privileges are never required to run I2P+. If you need to compile the <a href=http://i2p-projekt.i2p/jbigi.html target=_blank rel=noreferrer>jBigi library</a> (which is necessary in rare cases), consult the documentation, visit the forums, or visit <a href=irc://127.0.0.1:6668/saltR class=chatlink>the I2P+ channel</a> or <a href=irc://127.0.0.1:6668/i2p-dev class=chatlink>IRC developer channel</a>.";
    t[7453] = "[Linux/Unix/Solaris] Hvis du ikke kan starte routeren med <code>i2p/i2prouter start</code>, skal du pr\u00f8ve <code>runplain.sh</code>-scriptet i samme mappe. Der kr\u00e6ves aldrig root-privilegier for at k\u00f8re I2P+. Hvis du skal kompilere <a href=http://i2p-projekt.i2p/jbigi.html target=_blank rel=noreferrer>jBigi biblioteket</a> (hvilket er n\u00f8dvendigt i sj\u00e6ldne tilf\u00e6lde), skal du konsultere dokumentationen, bes\u00f8ge forummet eller bes\u00f8ge <a href=irc://127.0.0.1:6668/saltR class=chatlink>I2P+ kanalen</a> eller <a href=irc://127.0.0.1:6668/i2p-dev class=chatlink>IRC udviklerkanalen</a>.";
