    t[7458] = "Information defining the unique identity of a router on the network which includes its IP address (or the IP addresses of intermediate introducers) and listening port, public signing and encryption keys. Router identities correlate to peers in the NetDB. Also referred to as a <i>RouterInfo</i>.";
    t[7459] = "Information, der definerer den unikke identitet af en router p\u00e5 netv\u00e6rket, hvilket inkluderer dens IP-adresse (eller IP-adresserne p\u00e5 mellemliggende introducerere) og lytteport, offentlige signering og krypteringsn\u00f8gler. Routeridentiteter korrelerer til peers i NetDB. Ogs\u00e5 kendt som en <i>RouterInfo</i>.";
