    t[7690] = "A distributed database containing router contact information (RouterInfos) and destination contact information (LeaseSets). A single router maintains its own (partial) database for communicating with other routers on the network; no single router will maintain a list of all routers. The RouterInfos are stored on disk and read into memory when the router starts, or when new RouterInfos are acquired. Also referred to as the <i>NetDb</i>. For more information, see the <a href=https://geti2p.net/en/docs/how/network-database class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[7691] = "En distribueret database, der indeholder routernes kontaktoplysninger (RouterInfos) og destinationskontaktoplysninger (LeaseSets). En enkelt router opretholder sin egen (delvise) database til kommunikation med andre routere i netv\u00e6rket; ingen enkelt router vil opretholde en liste over alle routere. RouterInfos gemmes p\u00e5 disken og l\u00e6ses ind i hukommelsen, n\u00e5r routeren starter, eller n\u00e5r der erhverves nye RouterInfos. Ogs\u00e5 kendt som <i>NetDb</i>. For mere information, se <a href=https://geti2p.net/en/docs/how/network-database class='sitelink external' target=_blank rel=noreferrer>online-dokumentationen</a>.";
    t[7692] = "Address";
    t[7693] = "Adresse";
    t[7694] = "A threshold is defined by the number of connection attempts a remote destination is permitted to perform over a specified number of seconds before a \"breach\" occurs.";
    t[7695] = "En t\u00e6rskel er defineret ved antallet af forbindelsesfors\u00f8g, som en fjerndestination har tilladelse til at udf\u00f8re over et specificeret antal sekunder, f\u00f8r et \"brud\" opst\u00e5r.";
    t[7704] = "Clearnet normally refers to the publicly accessible internet, the opposite of the darknet that typically describes the encrypted, anonymous services built on I2P, Tor etc. For more information, see the <a href=https://en.wikipedia.org/wiki/Clearnet_(networking) class='sitelink external' target=_blank rel=noreferrer>Wikipedia article</a>.";
    t[7705] = "Normalt refererer Clearnet til den offentligt tilg\u00e6ngelige internet, det modsatte af darknet, som typisk beskriver de krypterede, anonyme tjenester, der er opbygget p\u00e5 I2P, Tor osv. For mere information, se <a href=https://en.wikipedia.org/wiki/Clearnet_(networking) class='sitelink external' target=_blank rel=noreferrer>Wikipedia-artiklen</a>.";
