    t[7990] = "A router on the network tasked with providing and receiving information about other routers and services on the network. The current minimum share bandwidth for a router to be considered as capable of performing floodfill duties is 128 KBytes/sec, though it's possible to override this requirement and force a router to be a floodfill on the <a href=/configadvanced>Advanced Configuration page</a>. For more information, see the <a href=https://geti2p.net/en/docs/how/network-database#floodfill class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[7991] = "En router p\u00e5 netv\u00e6rket, der er ansvarlig for at levere og modtage oplysninger om andre routere og tjenester p\u00e5 netv\u00e6rket. Den aktuelle minimum f\u00e6lles b\u00e5ndbredde for en router for at blive betragtet som i stand til at udf\u00f8re floodfill-opgaver er 128 KBytes / sek, men det er muligt at overskrive denne krav og tvinge en router til at v\u00e6re en floodfill p\u00e5 <a href = /configadvanced>Avanceret konfigurationsside</a>. For mere information, se <a href=https://geti2p.net/en/docs/how/network-database#floodfill class='sitelink external' target=_blank rel=noreferrer>den online dokumentation</a>.";
