    t[8208] = "Wherever possible, assets that are used repeatedly on your site should be loaded from an external file and not inlined. If you're using the same CSS on several pages, create a separate css file and load that in the <code>&lt;head&gt;</code> section of your pages. This will make styling updates to your site easier to manage, and will also allow the file to be cached in the visitor's browser, resulting in less bandwidth demands on your webserver and faster page loads for your visitors.";
    t[8209] = "Hvor det er muligt, b\u00f8r indhold, der bruges gentagne gange p\u00e5 dit websted, indl\u00e6ses fra en ekstern fil og ikke inlinet. Hvis du bruger den samme CSS p\u00e5 flere sider, skal du oprette en separat css-fil og indl\u00e6se den i <code>&lt;head&gt;</code>-sektionen p\u00e5 dine sider. Dette vil g\u00f8re det nemmere at h\u00e5ndtere stylingopdateringer p\u00e5 dit websted og tilladt, at filen kan caches i bes\u00f8gendes browser, hvilket resulterer i mindre b\u00e5ndbreddebehov p\u00e5 din webserver og hurtigere sideindl\u00e6sning for dine bes\u00f8gende.";
