    t[8336] = "On the I2P network, remotely hosted services can be accessed using a <a href=https://en.wikipedia.org/wiki/Base32 target=_blank rel=noreferrer class='sitelink external'>Base32</a> address ending in \".b32.i2p\", a <i>destination</i> represented as a long <a href=https://en.wikipedia.org/wiki/Base64 class='sitelink external'>Base64</a> string, or more usually by using an .i2p domain. A destination is I2P's equivalent to an IP address, and is shown on the <a href='/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration page</a>. You can share your b32.i2p address to allow others to access to your website until you've registered your own .i2p domain.";
    t[8337] = "P\u00e5 I2P-netv\u00e6rket kan eksternt hostede tjenester tilg\u00e5s ved hj\u00e6lp af en <a href=https://en.wikipedia.org/wiki/Base32 target=_blank rel=noreferrer class='sitelink external'>Base32</a>-adresse, der ender med \".b32.i2p\", en <i>destination</i> repr\u00e6senteret som en lang <a href=https://en.wikipedia.org/wiki/Base64 class='sitelink external'>Base64</a>-streng, eller mere almindeligt ved at bruge et .i2p-dom\u00e6ne. En destination er I2P's \u00e6kvivalent til en IP-adresse og vises p\u00e5 siden <a href='/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration</a>. Du kan dele din b32.i2p-adresse for at tillade andre at f\u00e5 adgang til din hjemmeside, indtil du har registreret dit eget .i2p-dom\u00e6ne.";
