    t[8410] = "To disable directory listings, find the entry for <code>org.eclipse.jetty.servlet.Default.dirAllowed</code> in the <code>base-context.xml</code> file, located in the <code>eepsite/contexts</code> folder (just above docroot folder), and change 'true' to 'false' immediately underneath. To apply the change immediately, stop and restart the <i>I2P Webserver</i> client on the <a href=/configclients>Client Configuration page</a>. You can also drop an empty <code>index.html</code> file in any exposed directory to suppress directory listings for that location.";
    t[8411] = "For at deaktivere mappelister skal du finde posten for <code>org.eclipse.jetty.servlet.Default.dirAllowed</code> i filen <code>base-context.xml</code>, der ligger i mappen <code>eepsite/contexts</code> (lige over docroot-mappen) og \u00e6ndre 'true' til 'false' med det samme. For at anvende \u00e6ndringen \u00f8jeblikkeligt skal du stoppe og genstarte <i>I2P Webserver</i>-klienten p\u00e5 <a href=/configclients>Klientkonfigurationssiden</a>. Du kan ogs\u00e5 inds\u00e6tte en tom <code>index.html</code> fil i en hvilken som helst eksponeret mappe for at undertrykke mappelister for den placering.";
