    t[8554] = "If you're not using IE, it's likely that your browser is pretending to be IE; please configure your browser (or proxy) to use a different User Agent string if you'd like to access the console themes.";
    t[8555] = "Hvis du ikke bruger IE, s\u00e5 er det muligt at din browser lader som om den er IE; v\u00e6r venlig at konfigurer din browser (eller proxy) til at bruge en anden User Agent hvis du \u00f8nsker at have adgang til konsol temaer.";
