    t[9052] = "Ready";
    t[9053] = "Klar";
    t[9056] = "These are the local services provided by your router. They may be clients started through the <a href='/i2ptunnelmgr'>Tunnel Manager</a> or external programs connecting through SAM, BOB, or directly to I2CP. By default, most of your client services (mail, http proxy, IRC) will share the same set of tunnels and be listed as <i>Shared Clients</i> and <i>Shared Clients(DSA)</i>, which enhances anonymity by blending the traffic from all shared services, and reduces the overhead required to build and maintain tunnels. However, if you experience a tunnel failure, all your services will go offline at the same time, so in some scenarios you may wish to configure client services to use their own set of tunnels. This can be done by unchecking the <i>Share tunnels with other clients&hellip;</i> option listed under <i>Shared Clients</i> on the configuration page of the relevant client service in the Tunnel Manager, after which you will need to restart the client service from the <a href='/i2ptunnelmgr'>main Tunnel Manager page</a>.";
    t[9057] = "Dette er de lokale tjenester, der leveres af din router. De kan v\u00e6re klienter, der startes gennem <a href='/i2ptunnelmgr'>Tunnel Manager</a> eller eksterne programmer, der forbinder gennem SAM, BOB eller direkte til I2CP. Som standard vil de fleste af dine klienttjenester (mail, HTTP-proxy, IRC) dele den samme s\u00e6t tunneler og blive opf\u00f8rt som <i>Delte klienter</i> og <i>Delte klienter (DSA)</i>, hvilket forbedrer anonymiteten ved at blande trafikken fra alle delte tjenester og reducerer den belastning, der kr\u00e6ves for at opbygge og vedligeholde tunneler. Men hvis en tunnelfejl opst\u00e5r, vil alle dine tjenester g\u00e5 offline p\u00e5 samme tid, s\u00e5 i nogle scenarier kan du muligvis \u00f8nske at konfigurere klienttjenesterne til at bruge deres eget s\u00e6t tunneler. Dette kan g\u00f8res ved at fjerne markeringen af indstillingen <i>Deler tunneler med andre klienter&hellip;</i>, der er angivet under <i>Delte klienter</i> p\u00e5 konfigurationssiden for den relevante klienttjeneste i Tunnel Manager, efter hvilken du bliver n\u00f8dt til at genstarte klienttjenesten fra <a href='/i2ptunnelmgr'>hovedsiden for Tunnel Manager</a>.";
