    t[9138] = "If you'd like to report a bug, please file a ticket on <a href=https://github.com/I2PPlus/i2pplus/issues target=_blank rel=noreferrer class=sitelink>github.com/I2PPlus/i2pplus/issues</a>. For developer-related discussions, please visit <a href=http://zzz.i2p/ target=_blank rel=noreferrer class=sitelink>zzz's developer forums</a> or come and visit the <a href=irc://127.0.0.1:6668/i2p-dev class=chatlink>developer channel</a> on I2P's IRC network.";
    t[9139] = "Hvis du gerne vil rapportere en fejl, bedes du indsende en billet p\u00e5 <a href=https://github.com/I2PPlus/i2pplus/issues target=_blank rel=noreferrer class=sitelink>github.com/I2PPlus/i2pplus/issues</a>. For udviklerrelaterede diskussioner, bedes du bes\u00f8ge <a href=http://zzz.i2p/ target=_blank rel=noreferrer class=sitelink>zzz's udviklerfora</a> eller kom forbi <a href=irc://127.0.0.1:6668/i2p-dev class=chatlink>udviklerkanalen</a> p\u00e5 I2Ps IRC-netv\u00e6rk.";
