    t[9240] = "A simple CGI application that takes a hostname as a parameter and returns a 301 redirect to the proper URL with a <code>?i2paddresshelper=key</code> string appended. The HTTP proxy will interpret the appended string and use the key as the actual destination. In addition, the proxy will cache the key so the address helper is not necessary until restart, and offer the option to add the resolved address to the addressbook.";
    t[9241] = "En simpel CGI-applikation, der tager et v\u00e6rtsnavn som en parameter og returnerer en 301-omdirigering til den korrekte URL med en <code>?i2paddresshelper=key></code> streng vedh\u00e6ftet. HTTP-proxyen vil tolke den vedh\u00e6ftede streng og bruge n\u00f8glen som det faktiske bestemmelsessted. Desuden vil proxy'en cachelagre n\u00f8glen, s\u00e5 adressenhj\u00e6lperen ikke er n\u00f8dvendig, indtil den genstartes, og den vil tilbyde muligheden for at tilf\u00f8je den l\u00f8ste adresse til adressebogen.";
