    t[9292] = "This setting (in minutes) allows you to manually configure how long to wait after startup before RouterInfos in the NetDb are checked for validity, after which point only valid routers will be accepted for inclusion. When the validation occurs, expired RouterInfos and unresponsive peers only accessible via SSU will be removed from the NetDb. [Default is 60 minutes] Note: This setting has no bearing on older routers (older than 0.9.29 by default) which are removed from the NetDb and banned for the router session as soon as a NetDb store is attempted.";
    t[9293] = "Denne indstilling (i minutter) giver dig mulighed for manuelt at konfigurere, hvor l\u00e6nge der skal ventes efter opstart, f\u00f8r RouterInfos i NetDb kontrolleres for gyldighed, hvorefter kun gyldige routere accepteres til inkludering. N\u00e5r valideringen foretages, fjernes udl\u00f8bne RouterInfos og ikke-responsivt lede kun tilg\u00e6ngelige via SSU fra NetDb. [Standard er 60 minutter]. Bem\u00e6rk: Denne indstilling har ingen indflydelse p\u00e5 \u00e6ldre routere (\u00e6ldre end 0.9.29 som standard), der fjernes fra NetDb og er udelukket for router-sessionen, s\u00e5 snart der fors\u00f8ges en NetDb-butik.";
