    t[9354] = "Reseeding is the bootstrapping process used to find other routers when you first install I2P, or when your router has too few router references remaining. The default settings will work for most people. Change these only if HTTPS is blocked by a restrictive firewall and reseed has failed.";
    t[9355] = "Reseeding er bootstrapprocesen, der bruges til at finde andre routere, n\u00e5r du f\u00f8rst installerer I2P, eller n\u00e5r din router har for f\u00e5 routerreferencer tilbage. De standardindstillinger fungerer for de fleste mennesker. Skift kun disse, hvis HTTPS er blokeret af en restriktiv firewall og reseed ikke lykkes.";
    t[9362] = "This setting, when enabled, modifies the maximum additional random pong delay introduced for ping-enabled servers, if <code>i2p.streaming.enablePongDelay</code> is also enabled. Unless explicitly set, the default value of 50ms will be used.";
    t[9363] = "Denne indstilling, n\u00e5r den er aktiveret, \u00e6ndrer den maksimale yderligere tilf\u00e6ldige pong-forsinkelse, der introduceres for ping-aktiverede servere, hvis <code>i2p.streaming.enablePongDelay</code> ogs\u00e5 er aktiveret. Hvis v\u00e6rdien ikke er angivet eksplicit, vil standardv\u00e6rdien p\u00e5 50 ms blive brugt.";
