    t[9474] = "Your I2P+ router by default contributes to the network by routing internal, end-to-end encrypted traffic for other routers, known as <i>participation</i>. Bandwidth participation improves the anonymity level of all users on the network and maximizes your download speed.";
    t[9475] = "Din I2P+ Router bidrager som standard til netv\u00e6rket ved at dirigere interne, end-til-ende krypterede trafik for andre routere, kendt som <i> deltagelse </i>. B\u00e5ndbreddedeltagelse forbedrer anonymitetsniveauet for alle brugere p\u00e5 netv\u00e6rket og maksimerer din downloadhastighed.";
    t[9476] = "This setting permits the configuration of alternative NTP servers required to ensure that your router maintains accurate clock time. [Default is 0.pool.ntp.org,1.pool.ntp.org,2.pool.ntp.org]";
    t[9477] = "Denne indstilling muligg\u00f8r konfiguration af alternative NTP-servere, der er n\u00f8dvendige for at sikre, at din router opretholder n\u00f8jagtig tidsrum. [Standard er 0.pool.ntp.org, 1.pool.ntp.org, 2.pool.ntp.org]";
    t[9484] = "Optimize your images";
    t[9485] = "Optimer dine billeder";
    t[9488] = "Note that the profiler relies on sustained client tunnel usage to accurately profile peers.";
    t[9489] = "Bem\u00e6rk, at profileringsv\u00e6rkt\u00f8jet er afh\u00e6ngig af vedvarende klienttunnelbrug for n\u00f8jagtigt at profilere peers.";
    t[9492] = "If you are in a hurry and can't wait a few hours, you can tell people to use a \"jump\" address helper redirection service. This will usually work within a few minutes of your registering your hostname on the same site. Test it yourself first by entering <code>http://stats.i2p/cgi-bin/jump.cgi?a=<i>yourchosenhostname.i2p</i></code> into your browser. Once it is working, you can tell others to use it.";
    t[9493] = "Hvis du har travlt og ikke kan vente et par timer, kan du fort\u00e6lle folk at bruge en hj\u00e6lpeeroutingservice til \"jump\"-adressen. Dette vil normalt virke inden for et par minutter efter du har registreret dit v\u00e6rtsnavn p\u00e5 samme websted. Test det selv f\u00f8rst ved at indtaste <code>http://stats.i2p/cgi-bin/jump.cgi?a=<i>yourchosenhostname.i2p</i></code> i din browser. N\u00e5r det virker, kan du fort\u00e6lle andre at bruge den.";
