    t[9630] = "Tunnels built by other routers through your router. This may vary widely depending on network demand, your shared bandwidth, and amount of locally-generated traffic. The recommended method for limiting participating tunnels is to change your share percentage on the <a  href='/config'>Bandwidth Configuration page</a>. You may also limit the total number by setting <code>router.maxParticipatingTunnels=nnn</code> on the <a href='/configadvanced'>Advanced configuration page</a>. <a href='/configstats#tunnel.participatingTunnels'>[Enable graphing]</a>.";
    t[9631] = "Tunneler oprettet af andre routere gennem din router. Dette kan variere meget afh\u00e6ngigt af netv\u00e6rkets behov, din delte b\u00e5ndbredde og m\u00e6ngden af lokalt genereret trafik. Den anbefalede metode til at begr\u00e6nse deltagende tunneler er at \u00e6ndre din delingsprocent p\u00e5 <a  href='/config'>Konfiguration af b\u00e5ndbredde-siden</a>. Du kan ogs\u00e5 begr\u00e6nse det samlede antal ved at indstille <code>router.maxParticipatingTunnels=nnn</code> p\u00e5 <a href='/configadvanced'>Avanceret konfigurationsside</a>. <a href='/configstats#tunnel.participatingTunnels'>[Aktiv\u00e9r graf]</a>.";
