    t[10660] = "Services may be hosted on multiple routers simultaneously, by sharing the same private key for the destination. Multihoming can further enhance the security and stability of a server by providing redundancy; if a server is multihomed, when a server in the pool goes offline, the provided service will remain available, making it more difficult to correlate server downtime with a router going offline.";
    t[10661] = "Tjenester kan v\u00e6re hostet p\u00e5 flere routere samtidigt ved at dele den samme private n\u00f8gle til destinationen. Mangehoming kan yderligere forbedre sikkerheden og stabiliteten af en server ved at give redundans; hvis en server er mangehomed, n\u00e5r en server i puljen g\u00e5r offline, vil den leverede service forblive tilg\u00e6ngelig, hvilket g\u00f8r det sv\u00e6rere at korrelere servernedetid med en router, der g\u00e5r offline.";
