    t[11024] = "By default, I2P will use the system configured default browser to launch at startup. If you wish to nominate an alternative browser, you will need to edit your router.config file (or the <a href=/configadvanced>Advanced Configuration page</a> if you have enabled advanced console mode) and add a new configuration line <code>routerconsole.browser=/path/to/browser</code> or <code>routerconsole.browser=\\path\\to\\browser.exe</code> if using Windows, replacing <code>\\path\\to\\browser</code> with the location of the browser you wish to use. Note: If the path to your chosen browser contains spaces, you may need to encase the path in quotes e.g. <code>routerconsole.browser=\"C:\\Program Files\\Mozilla\\Firefox.exe\"</code>";
    t[11025] = "Som standard vil I2P bruge systemets konfigurerede standardbrowser til at starte ved opstart. Hvis du \u00f8nsker at nominere en alternativ browser, skal du redigere din router.config-fil (eller siden for <a href=/configadvanced>Avanceret konfiguration</a> hvis du har aktiveret avanceret konsoltilstand) og tilf\u00f8je en ny konfigurationslinje <code>routerconsole.browser=/path/to/browser</code> eller <code>routerconsole.browser=\\path\\to\\browser.exe</code> hvis du bruger Windows, hvor du erstatter <code>\\path\\to\\browser</code> med placeringen af \u200b\u200bden browser, du \u00f8nsker at bruge. Bem\u00e6rk: Hvis stien til din valgte browser indeholder mellemrum, skal du muligvis omgive stien med anf\u00f8rselstegn, f.eks. <code>routerconsole.browser=\"C:\\Program Files\\Mozilla\\Firefox.exe\"</code>";
