    t[11106] = "This setting (in hours) allows you to manually configure how old a RouterInfo is in order for it to be checked by the Refresh Routers Job. By default, the age of a RouterInfo before a refresh is intitiated scales according to the size of the NetDb, increasing as the NetDb grows in size. A value of 0 will force the Router Refresh Job to check every router in the NetDb, regardless of age.";
    t[11107] = "Denne indstilling (i timer) giver dig mulighed for manuelt at konfigurere, hvor gammel en RouterInfo skal v\u00e6re for at blive kontrolleret af jobbet Refresh Routers. Som standard skalerer alderen p\u00e5 en RouterInfo, inden en opdatering initieres, i forhold til st\u00f8rrelsen af NetDb, og stiger, n\u00e5r NetDb vokser i st\u00f8rrelse. En v\u00e6rdi p\u00e5 0 vil tvinge Jobbet Refresh Router til at kontrollere hver router i NetDb, uanset alder.";
