    t[11150] = "A tunnel to the main IRC server network within I2P, Irc2P, is created when I2P is installed (see the <a href=/i2ptunnelmgr>Tunnel Manager</a>), and is automatically started when the I2P router starts. To connect to it, tell your IRC client to connect to server: <code>127.0.0.1</code> port: <code>6668</code>.";
    t[11151] = "En tunnel til det prim\u00e6re IRC-servernetv\u00e6rk inden for I2P, Irc2P, oprettes, n\u00e5r I2P er installeret (se <a href=/i2ptunnelmgr>Tunnel Manager</a>) og startes automatisk, n\u00e5r I2P-routeren starter. For at oprette forbindelse til det skal du fort\u00e6lle din IRC-klient at oprette forbindelse til serveren: <code>127.0.0.1</code> port: <code>6668</code>.";
