    t[11516] = "In order to use a single set of tunnels for multiple client services, clients can be configured from the <i>Tunnel Manager</i> to operate in <i>Shared Client</i> mode. This mode conserves resources and blends the traffic from multiple clients into a single set of tunnels, making traffic analysis harder. Clients configured as Shared Clients share the same tunnel options.";
    t[11517] = "For at kunne bruge en enkelt s\u00e6t tuneles til flere klienttjenester kan klienter konfigureres fra <i>Tunnel Manager</i> til at fungere i <i>Delt klient</i>-tilstand. Denne tilstand bevarer ressourcer og blander trafikken fra flere klienter i en enkelt s\u00e6t tunneler, hvilket g\u00f8r trafikanalyse mere vanskelig. Klienter konfigureret som Delt klient deler de samme tunnelindstillinger.";
