    t[11658] = "Your modem or router may support <a href=https://wikipedia.org/wiki/Universal_Plug_and_Play target=_blank rel=noreferrer>Universal Plug &amp; Play</a> (UPnP), which permits automatic port forwarding. Ensure UPnP support for I2P+ is enabled on the <a href=/confignet>config page</a>, then try to activate UPnP on your modem/router and possibly your computer also. Now try restarting the <a href=/>I2P+ router</a>. If successful, I2P+ should report \"Status: OK\" in the side panel once the I2P+ router completes initial connectivity tests.";
    t[11659] = "Din modem eller router underst\u00f8tter muligvis <a href=https://wikipedia.org/wiki/Universal_Plug_and_Play target=_blank rel=noreferrer>Universal Plug &amp; Play</a> (UPnP), hvilket tillader automatisk portforwarding. S\u00f8rg for, at UPnP-underst\u00f8ttelse for I2P+ er aktiveret p\u00e5 <a href=/confignet>konfigurationssiden</a>, og pr\u00f8v derefter at aktivere UPnP p\u00e5 din modem/router og muligvis ogs\u00e5 din computer. Pr\u00f8v derefter at genstarte <a href=/>I2P+ routeren</a>. Hvis det lykkes, b\u00f8r I2P+ rapportere \"Status: OK\" i sidepanelet, n\u00e5r I2P+ routeren er f\u00e6rdig med initial tilslutningstest.";
