    t[12026] = "I2P FAQ";
    t[12027] = "I2P FAQ";
    t[12028] = "If you hover over the <i>Router Info</i> heading, your truncated router identity will be shown (the first four characters (24 bits) of your 44-character (256-bit) Base64 router hash). The full hash is shown on your <a href='netdb?r=.'>Network Database entry</a>. Never reveal this to anyone, as your router identity is uniquely linked to your IP address in the network database.";
    t[12029] = "Hvis du holder musemark\u00f8ren over overskriften <i>Router Info</i>, vises din afkortede routeridentitet (de f\u00f8rste fire tegn (24 bits) i din 44-tegners (256 bit) Base64-router-hash). Den fulde hash vises p\u00e5 din <a href='netdb?r=.'>indf\u00f8rsel i netv\u00e6rksdatabasen</a>. Afsl\u00f8r aldrig dette for nogen, da din routeridentitet er unikt forbundet med din IP-adresse i netv\u00e6rksdatabasen.";
