    t[12062] = "Using the <i class=example>explicit</i> directive, a threshold can be applied to a remote destination listed in the definition itself, with the option to specify custom thresholds for multiple destinations. Remote destinations can also be excluded from the default threshold using the <i class=example>allow</i> keyword, or permanently blocked using the <i class=example>deny</i> keyword:";
    t[12063] = "Ved hj\u00e6lp af direktivet <i class=example>eksplicit</i> kan en t\u00e6rskelv\u00e6rdi anvendes p\u00e5 en fjerndestination, der er opf\u00f8rt i definitionen selv, med muligheden for at specificere brugerdefinerede t\u00e6rskelv\u00e6rdier for flere destinationer. Fjerndestinationer kan ogs\u00e5 undtages fra den standardm\u00e6ssige t\u00e6rskelv\u00e6rdi ved brug af n\u00f8gleordet <i class=example>allow</i> eller permanent blokeret ved brug af n\u00f8gleordet <i class=example>deny</i>:";
